import * as ActionTypes from '../Types';
import { getData } from "../services";

const onGetAllPatients = payload => {
  return {
    type: ActionTypes.GET_ALL_PATIENTS,
    payload
  }
}

export const getAllPatients = (url) => {
  return getData(url, onGetAllPatients);
}
